import logo from './logo.svg';
import './App.css';
import {Component} from "react/cjs/react.production.min";

class App extends Component {
  constructor(){
    super();
    this.state ={users: []};
  }
  componentDidMount() {
    fetch('/users')
        .then(res => {
          console.log(res);
          return res.json()
        })
        .then(users => {
          console.log(users);
          this.setState({ users })
        });
  }
  render() {
    return (
        <div className="App">
          <h1>Users</h1>
          {this.state.users.map(user =>
              <div key={user.id}>user: {user.name} Password: {user.password}</div>
          )}
        </div>
    );
  }
}
export default App;
